import React from 'react'
import { Routes, Route } from 'react-router-dom'
// Pages:
import Navbar from './components/Navbar'
import Login from './pages/Login'

const App: React.FC = () => {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route 
          path="/login"
          element={<Login />}
        />
        <Route 
          path="/login"
          element={<Login />}
        />
      </Routes>
    </div>
  );
}

export default App;
